const toFirstUpper = (string) => {
    return string.charAt(0).toUpperCase() + string.slice(1);
};

const BadgeList = ({tags}) => {
    return (
        tags.map(t => {
        return (<Badge key={t} variant="light" className="mr-2">{t}</Badge>);
        })
    );
};

